import React from 'react'


function Product({id, img, title, price, showFun}) {


  return (
    <div className='product' id={ id } onClick={showFun}>
        <img src={ img } alt="item" />
        <div className="caption">
            <p> { title } </p>
            <p> { price } </p>
        </div>
    </div>
  )

}

export default Product
